      title: "ADHD / Neurodivergent Cleaning Checklists for the home",
      description:
        "READ BEFORE PURCHASING:\n\n** By purchasing this planner, you understand that this is a DIGITAL DOWNLOAD only. You will not receive a physical product. \n\nIt is YOUR responsibility to print this planner yourself or download to your tablet/phone.\n\nYou may use as a PDF or purchase an outside app:\n\niOS: GoodNotes 5 \nAndroid: Noteshelf **\n\n________________\n\n   ABOUT THIS PLANNER:\n\nAs a late in life ADHD diagnosed individual, I&#39;ve tried different planners and calendars and to-do lists but nothing seemed to work for me so I sat down and created my own. I made this specifically for my neurotypical brain (and now yours.) \n\nYou can choose to use all of these pages or simply choose the ones that suit your needs best (as not to overwhelm your brain because we know that happens). \n\nYou can either print this out weekly, use it on your tablet/iPad (You&#39;ll need to purchase/download these apps: GoodNotes 5 (for iOS) or Noteshelf (for Android) or you can laminate them (or buy dry erase pouches -- see links below) and use as dry erase pages.\n\nI purposely made it without any color because I found that the bright colors would distract me and it didn\u2019t feel \u201cneat\u201d enough. I also added small pictures on each page because who doesn\u2019t like to take a few moments and color sometimes. Coloring books didn\u2019t have to stop at age 8, c\u2019mon now. PLUS I created a coloring page with my art just for you! \nThere are also little doodle areas for your word vomit or your artistic masterpieces. I know I like to doodle when I am on the phone making an appointment to calm my anxiety or when I\u2019m thinking about what to write on my to-do list.\n\nI hope you love this planner and that it works for you. \n\nDon\u2019t forget to follow me on Instagram and TikTok (@ThatMomAbigail) where I talk all about being a mom who is learning to live with her ADHD.\n\n\n\n Thank you so much for your support and I really hope this helps you.\n\nRemember, you are amazing and you CAN do this!!\n\n\n\n\n***If you purchase this planner, you do not need to purchase the Cleaning Checklist listing. this planner includes all the Cleaning Checklist Pages.***\n\n________________\n\nHELPFUL TIPS:\n\nif you would like to only use a select few pages and turn them into a dry-erase board, here are some links of products that I use that you may find helpful:\n\nDry Erase Pouches: https://www.amazon.com/dp/B071HWJJ64?tag=onamzabigai08-20&linkCode=ic5&ascsubtag=amzn1.infl.us.product&creativeASIN=B071HWJJ64&ref=exp_aj_kellss_dp_vv_mw \n\nDry Erase Pens: https://www.amazon.com/dp/B07RPXKQY7?tag=onamzabigai08-20&linkCode=ic5&ascsubtag=amzn1.infl.us.product&creativeASIN=B07RPXKQY7&ref=exp_aj_kellss_dp_vv_mw\n\n\nPlease reach out with any questions.\n \n________________\n\n\n   IMPORTANT REMINDER:\n\nPlease do not print out extra copies or share digitally with friends or family. \nPlease direct them to my Etsy shop so they can purchase their own. \n I really do want to help you out but this took a lot of time and work and each copy sold helps provide for me and my family. \n\nThank you for understanding,\n\n\n\nAbigail",
