      title:
        "Overstimulated Retro ADHD T-Shirt, Neurodivergent Tee, Funny Relatable Shirt, ADHD Awareness, Gender-Neutral Adult Clothing, Mental Health",
      description:
        "This &quot;Overstimulated&quot; repeated word t-shirt appears in the colors of the ADHD flag - ADHD is *so much more* than the &quot;Oh look a squirrel!&quot; stereotypes that are often demeaning and don&#39;t capture what being neurodivergent can feel like, and our clothes at NoThoughtsJustVibes seek to represent the neurodivergent community in a way that&#39;s both positive and conversation provoking.\n\n____________________________________________________________\n\nThis Bella and Canvas 3001 brand short sleeved unisex / gender-neutral jersey t-shirt is sized for adults. These t-shirts have ribbed knit collars to improve shaping, and the shoulders have taping for better fit over time. Dual side seams hold the garment&#39;s shape for longer. This shirt is made of light fabric (100% Airlume combed and ringspun Cotton), runs true to size, is a retail fit, and has a tear away label. Any props or additional clothing used in the photos are unfortunately not included in your purchase. \n\nHere at NoThoughtsJustVibes we do not discriminate based on size - that means regardless of if you&#39;re purchasing a size S or a size 3XL, your price will be the same. We are currently trying to find a print provider with more inclusive sizing, so if the size you are looking for currently falls outside the S-3XL range please be patient with us! \n\nPlease wash this garment in cold water on gentle cycle, and be sure to turn it inside out to keep the design lasting brighter for longer. \n\nYou can tumble dry the shirt on low or let it air dry. It\u2019s not going to catch on fire or anything crazy if you don\u2019t follow these directions, but please note your design is likely to fade more quickly if you don\u2019t! \n\nIt is also not recommended that you use Bleach or Fabric Softener on this item. Please also avoid directly ironing on top of the design.\n\nThis item is made to order - Be sure to check the sizing chart before purchasing. If you are looking for a tighter fit, we recommend sizing down as these items are unisex and are made to be a little more loose. \n\nIf for some reason you receive your item and it is damaged, please contact us right away. We do accept returns for damage that occurs during processing or shipping as well as exchanges if your sizing is wrong. We ask that you contact us within 30 days of delivery to kickstart this process.",
