      description:
        "Neurodivergent Affirmation Stickers! THE ORIGINAL! \nDon&#39;t fall for the copies! Get the original neurodivergent affirmation back from the original artist \u2665\n\nBeing neurodivergent often comes with a lot of overthinking due to past experiences or anxiety around misunderstanding social cues. (neurotypicals are confusing!) Remind yourself that being yourself is not wrong! \n\nPerfect for sticking in your journal or stick on something you use regularly, like a waterbottle, to constantly remind yourself that being you is the best!\n\n8 Pack - Beautiful, vivid, handmade stickers in a compostable, ecofriendly &quot;cellophane&quot; bag with a handmade label!\n\nEach sticker is between 6cm-7cm long and 2cm-3cm high. \n\nThese stickers are super adhesive so you won&#39;t have to worry about them peeling off. For this reason I don&#39;t recommend replacing your sticker once it&#39;s stuck if you&#39;d like to use it again. A small amount of residue may be left when unpeeling but this is easily removed. \n\nStickers are waterproof! While the design itself will not smudge, even in water, I recommend only lightly hand washing any item you&#39;re placing your sticker on, eg waterbottles, if you want your sticker to last. \n\nPlease be aware - as my stickers are handmade they are posted from home. If you order additional items, eg hoodie, you will receive your stickers separately. \n\nShipping is free for those in the UK and super cheap for everyone else!\n\nStickers will be sent in a secure envelope but will not be tracked. Tracked shipping can be arranged but you will be charged for this. \n\nPhotos represent the stickers accurately at the time they are taken, however there may be small changes to colour, size or style when they arrive. This is because I am always making sure you get the best quality possible so small tweaks may be made.\n\nIf you love these designs, take a look at the rest of my shop! I make designs for people like me, who have chronic illnesses and disabilities. Thanks so much for supporting a small, disabled creator \u2665\n\nTHE INTELLECTUAL PROPERTY FOR THIS STICKER PACK IS OWNED BY ME AND COPIES WILL BE REPORTED! :)",
